import React, { Component } from 'react'
import profileHeader from '../../assets/images/profile-header.jpg'; 
import { Link } from 'react-router-dom'

class NavLink extends Component {
    render() {
        return (
            <Link to={this.props.link} className={this.props.active}><a href={this.props.link} className='text-secondryy fs-rg1 tr-1'>{this.props.name}</a></Link>
        )
    }
}

class NavLinkProfile extends Component {
    render() {
        return (
            <NavLink to={this.props.link} className={`p-2 m-0 d-flex justify-content-center align-items-center tr-1 ${this.props.active}`}>
                <a href={this.props.link}  className='text-secondryy fs-rg1 tr-1 me-3'>{this.props.name}</a>
                <img src={profileHeader} alt='profile' className='rounded-5 w-100 h-100'/>
            </NavLink>
        )
    }
}

export default NavLink;
export {NavLinkProfile};
